import React from 'react';
import Dashboard from '../statics/Dashboard';

const TerminatePage = ({ location }) => {
  // Extract pid and uid from URL parameters
  const searchParams = new URLSearchParams(location.search);
  const pid = searchParams.get('pid');
  const uid = searchParams.get('uid');

  // Render the Dashboard component with pid, uid, and status
  return (
    <Dashboard pid={pid} uid={uid} status="terminate" />
  );
};

export default TerminatePage;
